import React from 'react'
import { Navbar, Nav, Container, NavDropdown, Button, Row, Col, NavItem, NavLink } from 'react-bootstrap';
import { styled } from '@mui/material/styles';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import { connect } from 'react-redux';
import Paper from '@mui/material/Paper';

const StyledTableCell = styled(TableCell)(({ theme }) => ({
    [`&.${tableCellClasses.head}`]: {
        backgroundColor: theme.palette.common.black,
        color: theme.palette.common.white,
    },
    [`&.${tableCellClasses.body}`]: {
        fontSize: 14,
    },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
    '&:nth-of-type(odd)': {
        backgroundColor: theme.palette.action.hover,
    },
    // hide last border
    '&:last-child td, &:last-child th': {
        border: 0,
    },
}));

function createData(Hub, date, time, details) {
    return { Hub, date, time, details };
}
const rows = [];



const Shipmentdetails = (props) => {
    if(props.detailsfetched){
    const rows = [
        props.status.TransitEvents.map((event) => {
            createData('Hub', event.timestamp, event.timestamp, event.state)
        })

    ];}

    return (
        <Container>
            <Row>
                <Col className='col-12 col-md-8 '>
                    <TableContainer component={Paper}>
                        <Table sx={{ minWidth: 700 }} aria-label="customized table">
                            <TableHead>
                                <TableRow>
                                    <StyledTableCell>Hub</StyledTableCell>
                                    <StyledTableCell align="right">Date</StyledTableCell>
                                    <StyledTableCell align="right">Time</StyledTableCell>
                                    <StyledTableCell align="right">Details</StyledTableCell>
                                </TableRow>
                            </TableHead>
                            <TableBody>
                            
                                {rows.map((row) => (
                                    <StyledTableRow key={row.status}>
                                        <StyledTableCell component="th" scope="row">
                                            {row.hub}
                                        </StyledTableCell>
                                        <StyledTableCell align="right">{row.date}</StyledTableCell>
                                        <StyledTableCell align="right">{row.time}</StyledTableCell>
                                        <StyledTableCell align="right">{row.details}</StyledTableCell>
                                    </StyledTableRow>
                                ))} : null}
                            </TableBody>
                        </Table>
                    </TableContainer>

                </Col>
                <Col className='col-12 col-md-4 '>
                </Col>
            </Row>
        </Container>
    )
}

const mapStateToProps = state => ({

    status: state.guest.details,
    detailsfetched: state.guest.detailsfetched
})
export default connect(mapStateToProps)(Shipmentdetails);
